INSERT INTO `forum_categories` (`id`, `name`, `views`, `threads`, `posts`, `locked`, `cat_title`, `admin_only`, `available`, `description`, `creation_date`) VALUES
(1, 'General Discussion', 0, 83, 110, 0, 1, 0, 1, 'This is the place for conversation about all things GOODBLOX. Posts not pertaining to GOODBLOX will be mercilessly pruned by our crack squad of moderators.', 1542715537),
(2, 'Creations Gallery', 0, 6, 5, 0, 1, 0, 1, 'Discuss your ROBLOX creations and share the secrets of your success. Post requests for help building and scripting here.', 1542715537),
(3, 'Suggestions, Feedback, and Ideas', 0, 5, 13, 0, 1, 0, 1, 'Do you have a suggestion for how to make ROBLOX better? Share your feedback here.', 1542715832),
(4, 'Off Topic', 0, 7, 3, 0, 1, 0, 1, 'Feel like talking about stuff other than ROBLOX? Post here.', 1542715832),
(5, 'Building Help', 0, 0, 0, 0, 2, 0, 1, 'Learn the ins and outs of building structures in ROBLOX here! Share your techniques with other builders, discuss designs, and draft plans.', 1542715832),
(6, 'Scripting Help', 0, 0, 0, 0, 2, 0, 1, 'Need help with a script you are writing? Need to edit an existing script? Want to share your devious programming skills? For advanced ROBLOX users.', 1542715832),
(7, 'Technical Problems and Bug Report', 0, 0, 0, 0, 2, 0, 1, 'Are you having trouble installing or upgrading ROBLOX? Account troubles? Website problems? Have you found a bug? Post here!', 1542715832),
(8, 'Role-Playing', 0, 0, 0, 0, 3, 0, 1, 'Does your Robloxian want to fly to the moon? Command a ship? Lay siege to a castle? Start a role-playing thread here.', 1542715832),
(9, 'Rate My Robloxian', 0, 0, 0, 0, 3, 0, 1, 'Show the world of ROBLOX your character. Get feedback on your outfit.', 1542715832),
(10, 'Sports', 0, 0, 0, 0, 4, 0, 1, 'Show off your ROBLOX athlete. Or just hang out with other ROBLOX fans.', 1542715832),
(11, 'Music', 0, 0, 0, 0, 4, 0, 1, 'Does your Robloxian rock? Let people know. Or just talk about your favorite bands.', 1542715832),
(12, 'Rate My Robloxian', 0, 0, 0, 0, 4, 0, 1, 'Does your Robloxian belong on the silver screen, or in the pages of a novel? Show off your ROBLOX movie star, discuss your favorite TV series, films, and the books you love.', 1542715832);
